import React from 'react';


function ToDoList (props){
    console.log(props.toDoList)
    return (
        <div>
            <h1>To Do List</h1>
            {props.toDoList.map(todo => (
                <div key={todo.id}>
                    {todo.title}
                    {todo.director}
                </div>
            ))}
        </div>
    )
}

export default ToDoList;
